import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the main content to be loaded (look for the search input as a stable anchor)
    await page.waitForSelector('#searchInput', { timeout: 10000 });

    // Try to find a "Your Profile" link using a different selector strategy:
    // Use XPath to select the LAST occurrence of <a> with text "Your Profile"
    const [profileLink] = await page.$x("(//a[normalize-space(text())='Your Profile'])[last()]");
    if (!profileLink) {
      throw new Error('Could not find "Your Profile" link using XPath');
    }

    // Scroll into view and highlight for screenshot
    await profileLink.evaluate(el => el.scrollIntoView({block: 'center'}));
    await page.evaluate(el => { el.style.background = 'yellow'; }, profileLink);

    // Take screenshot before clicking
    const step2 = path.join(screenshotsDir, 'step_2_profile_link_highlighted.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the "Your Profile" link
    await profileLink.click();

    // Wait for the profile page to load by waiting for a unique element/text from Jun's profile
    // Use the full name "Jun Kim" as anchor
    await page.waitForSelector('text=Jun Kim', { timeout: 10000 });

    // Wait for the profile image to appear (alt="Jun Kim")
    await page.waitForSelector('img[alt="Jun Kim"]', { timeout: 10000 });

    // Take screenshot of the profile page
    const step3 = path.join(screenshotsDir, 'step_3_jun_profile.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract profile data for verification
    const extractedData = await page.evaluate(() => {
      const name = document.querySelector('.profile-info h2')?.innerText || '';
      const username = document.querySelector('.profile-info .username')?.innerText || '';
      const bio = document.querySelector('.profile-info .bio')?.innerText || '';
      const stats = Array.from(document.querySelectorAll('.profile-stats .stat')).map(stat => ({
        number: stat.querySelector('.stat-number')?.innerText,
        label: stat.querySelector('.stat-label')?.innerText
      }));
      return { name, username, bio, stats };
    });

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile content",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
